import 'dart:convert';

class County {
  int? id;
  String? name;
  int? city;

  County({this.id, this.name, this.city});

  County.fromJson(Map<String, dynamic> json) {
    id = json['id'];
    name = json['name'];
    city = json['city'];
  }

  Map<String, dynamic> toJson() {
    final Map<String, dynamic> data = new Map<String, dynamic>();
    data['id'] = this.id;
    data['name'] = this.name;
    data['city'] = this.city;
    return data;
  }

  static List<County> getCityCounties(int cityId){
    List bodyCategory = json.decode(County.jsonData);
    List<County> counties = bodyCategory.map((value) => County.fromJson(value)).toList();
    counties = counties.where((element) => element.city! == cityId).toList();
    return counties;
  }

  static List<String> getCountyNames(int cityId){
    List<String>? names = [];
    List<County> counties = getCityCounties(cityId);
    names = counties.map((e) => e.name!).toList();
    return names;
  }

  static String getCountyNameFromId(int countyId){
    List bodyCategory = json.decode(County.jsonData);
    List<County> counties = bodyCategory.map((value) => County.fromJson(value)).toList();
    for (var county in counties){
      if (countyId == county.id){
        return county.name!;
      }
    }
    return 'not found';
  }

  static County getCountyFromName(int cityId, String name){
    List bodyCategory = json.decode(County.jsonData);
    List<County> counties = bodyCategory.map((value) => County.fromJson(value)).toList();
    for(var county in counties){
      if(name == county.name && cityId == county.city! ){
        return county;
      }
    }
    return County();
  }

  static int getIdFromCountyName(int cityId, String countyName){
    List bodyCategory = json.decode(County.jsonData);
    List<County> counties = bodyCategory.map((value) => County.fromJson(value)).toList();
    for (var county in counties){
      if (countyName == county.name && cityId == county.id){
        return county.id!;
      }
    }
    return 0;
  }

  static County getCountyFromId(int countyId){
    List bodyCategory = json.decode(County.jsonData);
    List<County> counties = bodyCategory.map((value) => County.fromJson(value)).toList();
    for (var county in counties){
      if (countyId == county.id){
        return county;
      }
    }
    return counties.first;
  }


